test("Firewheel 300x250 Zip File With Both Zip Validation Functions", (done) => {
   app.getHTMLZipDimensionsFromMetaTag(atob(fireWheel300x250ZipFile)).then(resp => {
    if (resp[0] === 0 && resp[1] === 0) {
        app.getHTMLZipDimensionsGoogleWebDesigner(fireWheel300x250ZipFile).then(resp => {
            let widthPlusHeight = resp[0] + resp[1];
            expect(widthPlusHeight).toBe(550) 
            done();
        })
    }
    let widthPlusHeight = resp[0] + resp[1];
    expect(widthPlusHeight).toBe(550)
    done();
   })
  
})

